import React from 'react';
import Modal2 from '../Modal/Modal2';

const Modals = () => {
  return (
    <>
        <h2>Modales Segunda Forma</h2>
        <button> ModalEstilo2 </button>
         <Modal2>
          <h3>Model 2da forma</h3>
          <p>Hola este es contenido modal segunda forma</p>
          <img src="https://placeimg.com/100/100/animals" alt="Animals" />
         </Modal2>  
    </>)
};

export default Modals;
